];

const CURSOS_MOCK = [
  { id: 'c1', title: 'Onboarding de Cultura: O Jeito Synapse', category: 'Obrigat√≥rios' },
  { id: 'c2', title: 'Seguran√ßa da Informa√ß√£o 2025', category: 'Obrigat√≥rios' },
