                                  {/* Quiz */}
                                  {(module.type === ActivityType.QUIZ || module.type === ActivityType.SIMULATION) && (module.content as QuizQuestion[]).map((q, i) => (
                                      <div key={i} className="p-4 border border-gray-100 rounded-xl hover:border-primary/30 transition-colors group">
