                                            }
                                       </div>
                                  ))}

                                  {/* Fallback for others */}
                                  {!['Flashcards Ativos', 'Quiz Objetivo', 'Simulado Final', 'Tabela Comparativa'].includes(module.type) && (
                                      <div className="text-sm text-gray-500 italic">Visualiza√ß√£o detalhada simplificada para revis√£o. Conte√∫do gerado com sucesso.</div>
