                 <BrainCircuit className="w-5 h-5" /> Gerar & Validar
               </button>
            </div>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="p-8 max-w-5xl mx-auto">
      <header className="mb-12 text-center">
        <h1 className="text-4xl font-bold text-gray-900 mb-4">Criar Novo Curso</h1>
        <p className="text-gray-500 text-lg max-w-2xl mx-auto">
          Cole seu documento (PDF, DOCX, TXT) e deixe o Synapse transformar em uma experi√™ncia completa de Active Learning.
        </p>
      </header>

      <div className="bg-white rounded-3xl shadow-xl border border-gray-100 overflow-hidden">
        <div className="p-6 bg-gray-50 border-b border-gray-200 flex justify-between items-center">
