            <FileText className="w-5 h-5 text-blue-500" />
            Conte√∫do Fonte
          </div>
          <button onClick={() => setText(SAMPLE_TEXT)} className="text-sm text-primary-dark font-bold hover:underline">
            Carregar Exemplo
          </button>
        </div>
        <textarea
          className="w-full h-96 p-8 text-gray-700 resize-none focus:outline-none text-lg leading-relaxed font-light bg-white"
