import React, { useState } from 'react';
import { Team, Role, TeamInput, RoleInput } from '../types';

interface TeamRoleManagerProps {
  teams: Team[];
  roles: Role[];
  onAddTeam: (data: TeamInput) => Promise<void>;
  onAddRole: (data: RoleInput) => Promise<void>;
}

const TeamRoleManager: React.FC<TeamRoleManagerProps> = ({ teams, roles, onAddTeam, onAddRole }) => {
  const [teamName, setTeamName] = useState('');
  const [teamArea, setTeamArea] = useState('');
  const [roleName, setRoleName] = useState('');
  const [isSavingTeam, setIsSavingTeam] = useState(false);
  const [isSavingRole, setIsSavingRole] = useState(false);

  const handleAddTeam = async () => {
    if (!teamName.trim() || !teamArea.trim()) return;
    setIsSavingTeam(true);
    try {
      await onAddTeam({ name: teamName.trim(), area: teamArea.trim() });
      setTeamName('');
      setTeamArea('');
    } finally {
      setIsSavingTeam(false);
    }
  };

  const handleAddRole = async () => {
    if (!roleName.trim()) return;
    setIsSavingRole(true);
    try {
      await onAddRole({ name: roleName.trim() });
      setRoleName('');
    } finally {
      setIsSavingRole(false);
    }
  };

  return (
    <div className="p-8 max-w-6xl mx-auto">
      <h1 className="text-3xl font-bold text-gray-900 mb-6">Times e Cargos</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        <div className="bg-white rounded-2xl border border-gray-200 p-6">
