            <input className="w-full px-4 py-2.5 rounded-xl border border-gray-200" placeholder="√Årea" value={teamArea} onChange={(e) => setTeamArea(e.target.value)} />
            <div className="flex justify-end">
              <button
                className="px-4 py-2 rounded-xl bg-primary text-background-dark font-bold disabled:opacity-60"
                onClick={handleAddTeam}
                disabled={isSavingTeam}
              >
                {isSavingTeam ? 'Salvando...' : 'Salvar Time'}
              </button>
            </div>
          </div>
          <div className="mt-6">
            <h3 className="text-sm font-bold text-gray-600 mb-2">Times cadastrados</h3>
            <ul className="space-y-2">
              {teams.map(t => (
                <li key={t.id} className="px-3 py-2 rounded border border-gray-200 text-sm flex justify-between">
                  <span>{t.name} ‚Ä¢ {t.area}</span>
                  <span className="text-xs text-gray-400">{t.stats?.memberCount ?? 0} membros</span>
                </li>
              ))}
              {teams.length === 0 && (
                <li className="px-3 py-2 rounded border border-gray-200 text-sm text-gray-500">Nenhum time cadastrado</li>
              )}
            </ul>
          </div>
        </div>

        <div className="bg-white rounded-2xl border border-gray-200 p-6">
          <h2 className="text-xl font-bold text-gray-800 mb-4">Cadastrar Cargo</h2>
          <div className="space-y-3">
            <input className="w-full px-4 py-2.5 rounded-xl border border-gray-200" placeholder="Nome do cargo" value={roleName} onChange={(e) => setRoleName(e.target.value)} />
            <div className="flex justify-end">
              <button
                className="px-4 py-2 rounded-xl bg-primary text-background-dark font-bold disabled:opacity-60"
                onClick={handleAddRole}
                disabled={isSavingRole}
              >
                {isSavingRole ? 'Salvando...' : 'Salvar Cargo'}
